import React, { useState, useEffect } from "react";
import { useRouter } from "next/router";
import getAllLaunches from "../../services/getAllLaunches";
import PastCard from "../../components/PastCard";

const Result = () => {
  const router = useRouter();


const [launches, setlaunches] = useState([]);

useEffect(() => {
  getAllLaunches().then((data) => setlaunches(data));
}, []);

  console.log(launches)
  return (
    <div>
      <br />
      <br />
      <br />
      <br />
      <p>hola {router.query.key}</p>
      <div>
        {/* {launches.map((item, index) => {
          if (index > launches.length - 3) {
            return (
              <PastCard
                key={item.id}
                title={item.name}
                detail={item.details}
                image={item.links.patch.small}
                number={item.flight_number}
                date={item.date_local}
                succes={item.succes ? "succes" : "fail"}
              />
            );
          }
        })} */}
        {launches.filter((item) => {
          item.name == router.query.key;
            return (
              <PastCard
                key={item.id}
                title={item.name}
                detail={item.details}
                image={item.links.patch.small}
                number={item.flight_number}
                date={item.date_local}
                succes={item.succes ? "succes" : "fail"}
              />
            );
        })}
      </div>
    </div>
  );
};

export default Result;
